import React, { useState } from 'react';
import './App.css';

function App() {
  const [activeTab, setActiveTab] = useState('find');
  const [plateNumber, setPlateNumber] = useState('');
  const [carLocation, setCarLocation] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  
  // Park car simulation
  const [parkFloor, setParkFloor] = useState('1');
  const [parkSpot, setParkSpot] = useState('A1');
  const [parkPlate, setParkPlate] = useState('');
  const [parkSuccess, setParkSuccess] = useState(false);

  const API_URL = 'http://localhost:3000';

  const findCar = async (e) => {
    e.preventDefault();
    setError('');
    setCarLocation(null);
    setLoading(true);

    try {
      const response = await fetch(`${API_URL}/find/${plateNumber.toUpperCase()}`);
      const data = await response.json();

      if (data.success) {
        setCarLocation(data.data);
      } else {
        setError(data.error || 'Car not found');
      }
    } catch (err) {
      setError('Failed to connect to server');
    } finally {
      setLoading(false);
    }
  };

  const simulatePark = async (e) => {
    e.preventDefault();
    setError('');
    setParkSuccess(false);
    setLoading(true);

    try {
      const response = await fetch('http://localhost:5000/simulate-detection', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          plate: parkPlate.toUpperCase(),
          floor: parseInt(parkFloor),
          spot: parkSpot.toUpperCase(),
        }),
      });

      const data = await response.json();

      if (data.success) {
        setParkSuccess(true);
        setParkPlate('');
      } else {
        setError(data.error || 'Failed to park car');
      }
    } catch (err) {
      setError('Failed to connect to server');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="app-header">
        <h1>üöó Smart Parking System</h1>
        <p>AI-Powered License Plate Recognition</p>
      </header>

      <div className="tabs">
        <button
          className={activeTab === 'find' ? 'tab active' : 'tab'}
          onClick={() => setActiveTab('find')}
        >
          Find My Car
        </button>
        <button
          className={activeTab === 'park' ? 'tab active' : 'tab'}
          onClick={() => setActiveTab('park')}
        >
          Simulate Parking
        </button>
      </div>

      <div className="content">
        {activeTab === 'find' && (
          <div className="card">
            <h2>Find Your Car</h2>
            <form onSubmit={findCar}>
              <div className="form-group">
                <label>Enter License Plate Number</label>
                <input
                  type="text"
                  value={plateNumber}
                  onChange={(e) => setPlateNumber(e.target.value)}
                  placeholder="e.g., ABC1234"
                  required
                  className="input-field"
                />
              </div>
              <button type="submit" className="btn-primary" disabled={loading}>
                {loading ? 'Searching...' : 'Find My Car'}
              </button>
            </form>

            {error && (
              <div className="alert alert-error">
                <span className="icon">‚ö†Ô∏è</span>
                {error}
              </div>
            )}

            {carLocation && (
              <div className="result-card">
                <div className="success-icon">‚úÖ</div>
                <h3>Car Found!</h3>
                <div className="location-details">
                  <div className="detail-item">
                    <span className="label">License Plate:</span>
                    <span className="value">{carLocation.plate}</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Floor:</span>
                    <span className="value floor-badge">{carLocation.floor}</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Spot:</span>
                    <span className="value spot-badge">{carLocation.spot}</span>
                  </div>
                  <div className="detail-item">
                    <span className="label">Parked At:</span>
                    <span className="value">
                      {new Date(carLocation.parked_at).toLocaleString()}
                    </span>
                  </div>
                </div>
              </div>
            )}
          </div>
        )}

        {activeTab === 'park' && (
          <div className="card">
            <h2>Simulate Car Entry</h2>
            <p className="subtitle">
              In a real system, cameras would detect this automatically
            </p>
            <form onSubmit={simulatePark}>
              <div className="form-group">
                <label>License Plate</label>
                <input
                  type="text"
                  value={parkPlate}
                  onChange={(e) => setParkPlate(e.target.value)}
                  placeholder="e.g., XYZ5678"
                  required
                  className="input-field"
                />
              </div>
              <div className="form-row">
                <div className="form-group">
                  <label>Floor</label>
                  <select
                    value={parkFloor}
                    onChange={(e) => setParkFloor(e.target.value)}
                    className="input-field"
                  >
                    {[1, 2, 3, 4, 5].map((floor) => (
                      <option key={floor} value={floor}>
                        Floor {floor}
                      </option>
                    ))}
                  </select>
                </div>
                <div className="form-group">
                  <label>Spot</label>
                  <input
                    type="text"
                    value={parkSpot}
                    onChange={(e) => setParkSpot(e.target.value)}
                    placeholder="e.g., B12"
                    required
                    className="input-field"
                  />
                </div>
              </div>
              <button type="submit" className="btn-primary" disabled={loading}>
                {loading ? 'Parking...' : 'Park Car'}
              </button>
            </form>

            {error && (
              <div className="alert alert-error">
                <span className="icon">‚ö†Ô∏è</span>
                {error}
              </div>
            )}

            {parkSuccess && (
              <div className="alert alert-success">
                <span className="icon">‚úÖ</span>
                Car parked successfully! You can now find it using the "Find My Car" tab.
              </div>
            )}
          </div>
        )}
      </div>

      <footer className="app-footer">
        <p>Smart Parking System v1.0 | AI-Powered ANPR Technology</p>
      </footer>
    </div>
  );
}

export default App;
